        dfs(row, col)
        for i in range(len(visited)):
            if A[i][j] == '#':
                return visited.pop(i)
        return None

    def is_parallel(row1, col1, row2, col2):
        def dfs(x, y):
            nonlocal visited
            if (x, y) in visited:
                return
            visited.add((x, y))
            if A[x][y] == '.' and (x + 1, y) not in visited:
                dfs(x + 1, y)
            if A[x][y] == '.' and (x - 1, y) not in visited:
                dfs(x - 1, y)
            if A[x][y] == '.' and (x, y + 1) not in visited:
                dfs(x, y + 1)
            if A[x][y] == '.' and (x, y - 1) not in visited:
                dfs(x, y - 1)

        dfs(row1, col1)
        dfs(row2, col2)
