def solution(stdin: str) -> str:
    # Read input
    n, m = map(int, stdin.split())
    edges = [tuple(map(int, stdin.split())) for _ in range(m)]

    # Create dictionary to store the weight of each edge
    edge_weight = {}
    for i, edge in enumerate(edges):
        u, v, w = edge
        if (u, v) not in edge_weight:
            edge_weight[(u, v)] = set()
        edge_weight[(u, v)].add((i, w))

    # Initialize variables
    dp = [0] * (n + 1)
    edge_count = 0

    # Run BellmanFord algorithm
    for i in range(1, n + 1):
        dp[i] = float('inf')
        for j in range(1, n + 1):
            if j!= i and (i, j) in edge_weight:
                for (u, v), (u_idx, w) in edge_weight[(i, j)].items():
                    if dp[u]!= float('inf') and dp[u] + w < dp[j]:
                        dp[j] = dp[u] + w

    # Check if MST is unique
    for i in range(1, n + 1):
        if dp[i] == float('inf'):
            break
    else:
        # MST is unique
        result = 0
        while True:
            u, v, w = edges[edge_count]
            if (u, v) in edge_weight and (u, v) not in result:
                result.add((u, v))
                edge_count += 1
            else:
                break

    # Print result
    return str(result)

