    for i, char in enumerate(program):
        # If the character is an opening delimiter, push it onto the stack
        if char in opening_delimiters:
            stack.append(i)
            opening_delimiters[char] = i
        # If the character is a closing delimiter, pop the top element from the stack
        elif char in closing_delimiters:
            top = stack.pop()
            opening_delimiters[closing_delimiters[char]] = top
            # If the stack is empty, the program is valid
            if not stack:
                break

    # If there are no errors, print 'ok so far'
    if not stack:
        return 'ok so far'

    # Find the character and its index
    last_opening = None
    for char, index in opening_delimiters.items():
        if char == '(':
            last_opening = index
        elif char == ')':
            if last_opening is None:
                return'syntax error: found ')' without opening '(''
